//引入Vue
import Vue from 'vue';
//引入App组件
import App from './App.vue';
//引入插件
import vueResource from 'vue-resource'
// 引入vuex
import Vuex from 'vuex'

Vue.config.productionTip = false
//使用插件
Vue.use(vueResource)
Vue.use(Vuex)

new Vue({
    el: '#app',
    render: h => h(App),
    store:'hello',
    beforeCreate() {
        Vue.prototype.$bus = this
    },
    mounted(){
        console.log(this);
    }
});
